methods.body:
Optional[{
    // Check the type of site and gets the number of results
    switch(pTipologiaSito) {
        case BENE_CULTURALE:
            return BeneCulturale.ottieniNumeroElementiRicerca(this.pParoleChiave, this.pTags, this.pPosizioneUtente, this.pRaggioMax);
        case PUNTO_DI_RISTORO:
            return PuntoDiRistoro.ottieniNumeroElementiRicerca(this.pParoleChiave, this.pTags, this.pPosizioneUtente, this.pRaggioMax);
        default:
            return -1;
    }
}]

Optional[{
    // Check the type of site and search
    switch(pTipologiaSito) {
        case BENE_CULTURALE:
            return BeneCulturale.ricerca(pParoleChiave, pTags, pNumeroPagina, numeroElementiPerPagina, pPosizioneUtente, pRaggioMax);
        case PUNTO_DI_RISTORO:
            return PuntoDiRistoro.ricerca(pParoleChiave, pTags, pNumeroPagina, numeroElementiPerPagina, pPosizioneUtente, pRaggioMax);
        default:
            return null;
    }
}]
